import React, { useState, useEffect, useRef } from 'react';
import { useNavigate } from 'react-router-dom'; // 1. useNavigate ÌõÖÏùÑ import Ìï©ÎãàÎã§.
import './Header.css';

export default function Header() {
  const [query, setQuery] = useState('');
  const [results, setResults] = useState([]);
  const [message, setMessage] = useState('');
  const [showResults, setShowResults] = useState(false);
  const searchContainerRef = useRef(null);
  const IP = "172.17.154.182:8080"; // Í≤ÄÏÉâ API ÏÑúÎ≤Ñ IP

  const navigate = useNavigate(); // 2. useNavigate ÌõÖÏùÑ Ï¥àÍ∏∞ÌôîÌï©ÎãàÎã§.

  useEffect(() => {
    function handleClickOutside(event) {
      if (searchContainerRef.current && !searchContainerRef.current.contains(event.target)) {
        setShowResults(false);
      }
    }
    document.addEventListener("mousedown", handleClickOutside);
    return () => {
      document.removeEventListener("mousedown", handleClickOutside);
    };
  }, [searchContainerRef]);

  useEffect(() => {
    if (!query.trim()) {
      setResults([]);
      setMessage('');
      setShowResults(false);
      return;
    }

    setShowResults(true);

    const timeoutId = setTimeout(async () => {
      try {
        const apiUrl = `http://${IP}/search?q=${encodeURIComponent(query)}`;
        console.log(`Í≤ÄÏÉâ ÏöîÏ≤≠: ${apiUrl}`);

        const res = await fetch(apiUrl);

        if (!res.ok) {
          const errorText = await res.text();
          throw new Error(`ÎÑ§Ìä∏ÏõåÌÅ¨ ÏùëÎãµ Ïò§Î•ò: ${res.status} - ${errorText}`);
        }

        const data = await res.json();

        if (data.length === 0) {
          setResults([]);
          setMessage('Í≤ÄÏÉâ Í≤∞Í≥ºÍ∞Ä ÏóÜÏäµÎãàÎã§.');
        } else {
          setResults(data);
          setMessage('');
        }
      } catch (error) {
        console.error('Í≤ÄÏÉâ Ï§ë Ïò§Î•ò Î∞úÏÉù:', error);
        setResults([]);
        if (error.message.includes('Failed to fetch')) {
          setMessage('ÏÑúÎ≤Ñ Ïó∞Í≤∞Ïóê Ïã§Ìå®ÌñàÏäµÎãàÎã§. CORS ÎòêÎäî ÎÑ§Ìä∏ÏõåÌÅ¨ ÏÑ§Ï†ïÏùÑ ÌôïÏù∏ÌïòÏÑ∏Ïöî.');
        } else {
          setMessage('Í≤ÄÏÉâ Ï§ë Ïò§Î•òÍ∞Ä Î∞úÏÉùÌñàÏäµÎãàÎã§.');
        }
      }
    }, 300);

    return () => clearTimeout(timeoutId);
  }, [query, IP]); // IP Ï£ºÏÜåÎèÑ ÏùòÏ°¥ÏÑ± Î∞∞Ïó¥Ïóê Ï∂îÍ∞Ä

  const handleInputChange = (e) => {
    setQuery(e.target.value);
  };

  // 3. Í≤ÄÏÉâ Í≤∞Í≥º Ìï≠Î™© ÌÅ¥Î¶≠ Ïãú Ìò∏Ï∂úÎê† Ìï®ÏàòÎ•º Ï†ïÏùòÌï©ÎãàÎã§.
  const handleResultClick = (item) => {
    // ChartPageÎ°ú Ïù¥ÎèôÌïòÎ©¥ÏÑú URL ÌååÎùºÎØ∏ÌÑ∞Î°ú tickerÎ•º, stateÎ°ú Ï¢ÖÎ™©Î™ÖÍ≥º Ï¢ÖÎ™© ÏÜåÏä§(Ï∂úÏ≤ò)Î•º Ï†ÑÎã¨Ìï©ÎãàÎã§.
    navigate(`/chart/${item.ticker}`, {
      state: {
        stockName: item.name,     // Ï¢ÖÎ™©Î™Ö Ï†ÑÎã¨
        stockSource: item.source  // Ï¢ÖÎ™© Ï∂úÏ≤ò(Ïòà: KRX, NASDAQ) Ï†ÑÎã¨
      }
    });

    // Í≤ÄÏÉâÏ∞ΩÏùÑ ÎπÑÏö∞Í≥† Í≤∞Í≥º Î™©Î°ùÏùÑ Ïà®ÍπÅÎãàÎã§.
    setQuery('');
    setResults([]);
    setShowResults(false);
  };

  return (
    <header className="header">
      <div className="search-container" ref={searchContainerRef}>
        <input
          className="search-input"
          placeholder="üîç Í≤ÄÏÉâ"
          value={query}
          onChange={handleInputChange}
          onFocus={() => query && setShowResults(true)}
          autoComplete="off"
        />
        {showResults && query.length > 0 && (
          <div className="search-results">
            {results.length > 0 && (
              <ul>
                {results.map((item) => (
                  // 4. li ÏöîÏÜåÏóê onClick Ïù¥Î≤§Ìä∏Î•º Ï∂îÍ∞ÄÌïòÍ≥† handleResultClick Ìï®ÏàòÎ•º Ïó∞Í≤∞Ìï©ÎãàÎã§.
                  <li
                    key={item.ticker}
                    onClick={() => handleResultClick(item)}
                    style={{ cursor: 'pointer' }} // ÌÅ¥Î¶≠ Í∞ÄÎä•ÌïòÎã§Îäî Í≤ÉÏùÑ ÏïåÎ†§Ï£ºÍ∏∞ ÏúÑÌï¥ Ïª§ÏÑú Ïä§ÌÉÄÏùº Ï∂îÍ∞Ä
                  >
                    {`[${item.ticker}] ${item.name} (${item.source})`}
                  </li>
                ))}
              </ul>
            )}
            {message && <div className="search-message">{message}</div>}
          </div>
        )}
      </div>
      <button className="login-btn">Î°úÍ∑∏Ïù∏</button>
    </header>
  );
}
